import './App.css';
import jwt from "jwt-token";

function App() {

  const queryParameters = new URLSearchParams(window.location.search);
  const token = queryParameters.get('token');

  const decoded = jwt(token);
  return (
    <>
    <div>
      <h1>{token}</h1>
      <h1>{decoded}</h1>
    </div>
    </>
  );
}

export default App;
